import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  MapContainer,
  TileLayer,
  Marker,
  Popup,
  Polyline,
} from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

// Fix marker icon issue
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl:
    'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon-2x.png',
  iconUrl:
    'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon.png',
  shadowUrl:
    'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
});

// Responder location (PUP Bi√±an, adjust as needed)
const responderLat = 14.3110;
const responderLng = 121.0794;

function calculateDistance(lat1, lon1, lat2, lon2) {
  const toRad = (value) => (value * Math.PI) / 180;
  const R = 6371;
  const dLat = toRad(lat2 - lat1);
  const dLon = toRad(lon2 - lon1);
  const a =
    Math.sin(dLat / 2) ** 2 +
    Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) * Math.sin(dLon / 2) ** 2;
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
}

function Dashboard() {
  const [location, setLocation] = useState(null);
  const [distance, setDistance] = useState(null);
  const [pathHistory, setPathHistory] = useState([]);
  const [historicalPoints, setHistoricalPoints] = useState([]);

  // Fetch current location every 5 seconds
  useEffect(() => {
    const fetchLocation = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/location/latest');
        if (res.data && typeof res.data.latitude === 'number') {
          const newLoc = {
            latitude: res.data.latitude,
            longitude: res.data.longitude,
          };
          setLocation(newLoc);
          setPathHistory((prev) => [...prev, [newLoc.latitude, newLoc.longitude]]);
          const dist = calculateDistance(
            responderLat,
            responderLng,
            newLoc.latitude,
            newLoc.longitude
          );
          setDistance(dist);
        }
      } catch (err) {
        console.error('Error fetching current location:', err);
      }
    };

    fetchLocation();
    const interval = setInterval(fetchLocation, 5000);
    return () => clearInterval(interval);
  }, []);

  // Fetch historical SOS points
  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/location/history');
        if (Array.isArray(res.data)) {
          setHistoricalPoints(res.data); // Expected format: [{latitude, longitude, timestamp}]
        }
      } catch (err) {
        console.error('Error fetching history:', err);
      }
    };

    fetchHistory();
  }, []);

  const isNear = distance !== null && distance < 1;

  return (
    <div className="bg-white p-4 rounded shadow">
      <h2 className="text-xl font-semibold mb-4">üì° Live GPS Tracker</h2>

      <div className="flex gap-4 mb-4">
        <button
          onClick={() => setPathHistory([])}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          üîÑ Reset Path
        </button>
        <button
          onClick={() => window.location.reload()}
          className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
        >
          üîÉ Reload All
        </button>
      </div>

      {location ? (
        <>
          <p>üìç Latitude: {location.latitude}, Longitude: {location.longitude}</p>
          <p>üìè Distance from Responder: {distance?.toFixed(2)} km</p>

          <MapContainer
            center={[location.latitude, location.longitude]}
            zoom={17}
            style={{ height: '700px', width: '100%', marginTop: '1rem' }}
          >
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution="&copy; OpenStreetMap contributors"
            />

            {/* Responder marker */}
            <Marker position={[responderLat, responderLng]}>
              <Popup>Responder Location</Popup>
            </Marker>

            {/* Live User marker */}
            <Marker
              position={[location.latitude, location.longitude]}
              icon={new L.Icon({
                iconUrl: isNear
                  ? 'https://maps.google.com/mapfiles/ms/icons/green-dot.png'
                  : 'https://maps.google.com/mapfiles/ms/icons/red-dot.png',
                iconSize: [32, 32],
              })}
            >
              <Popup>üìç User Now</Popup>
            </Marker>

            {/* Draw live movement path */}
            {pathHistory.length > 1 && (
              <Polyline positions={pathHistory} color="blue" />
            )}

            {/* Historical SOS markers */}
            {historicalPoints.map((pt, index) => (
              <Marker
                key={index}
                position={[pt.latitude, pt.longitude]}
                icon={new L.Icon({
                  iconUrl: 'https://maps.google.com/mapfiles/ms/icons/orange-dot.png',
                  iconSize: [24, 24],
                })}
              >

              </Marker>
            ))}
          </MapContainer>
        </>
      ) : (
        <p>‚è≥ Waiting for GPS data...</p>
      )}
    </div>
  );
}

export default Dashboard;
